    return (
        AllProducts.map((item) => {
            console.log("hello")
            return (
                <div className="">
                <ul className="list-tag">
                <li><ProductCard title={item.name} src={item.img} price={item.price}/> </li>
              </ul>
               
                </div>
            )
        })

    )


}
